import React, { useState } from "react";
import Box from '@mui/material/Box';
import TextField from '@mui/material/TextField';
import { styled, alpha } from '@mui/material/styles';
import InputBase from '@mui/material/InputBase';
import SearchIcon from '@mui/icons-material/Search';
import "./style.css";

export default function Invoice() {

  const [data, setData] = useState([]);


  const [compName, setCompName] = useState("");
  const [compAddress, setCompAddress] = useState("");
  const [compNumber, setCompNumber] = useState("");
  const [compinvoiceId, setInvoiceID] = useState("");
  const [compInvoiceDate, setCompInvoiceDate] = useState("");
  const [customerName, setCustomerName] = useState("");
  const [customerAddress, setCustomerAddress] = useState("");
  const [customerNumber, setCustomerNumber] = useState("");
  const [customerEmail, setCustomerEmail] = useState("");
  const [compdueDate, setDueDate] = useState("");
  const [paymentDate, setPaymentDate] = useState("");
  const [tableProductDate, setTableProductDate] = useState("");
  const [Description, setDescription] = useState("");
  const [quntity, setQuntity] = useState("");
  const [rate, setRate] = useState("");
  const [amount, setAmounts] = useState("");
  const [tax, setTax] = useState("");
  const [taxAmount, setTaxAmount] = useState("");
  const [totalAmount, setTotalAmount] = useState("");
  const [tablePaymentId, setTablePaymentId] = useState("");
  const [tableBankName, setTableBankName] = useState("");
  const [tableAccNumber, setTableAccNumber] = useState("");
  const [tableifscCode, setTableifscCode] = useState("");

  const handelevent = async (e) => {
    e.preventDefault();
    await fetch(
    'http://localhost:5000/invoice', {
        method: "get"
    })
    .then((res) => res.json())
    .then((da) => {
      
      setData(da);
      setData(da);
      da.map(i => {
        setCompName(i.compName);
        setCompAddress(i.compAddress);
        setCompNumber(i.compNumber);
        setInvoiceID(i._id);
        setCompInvoiceDate(i.compInvoiceDate);
        setCustomerName(i.customerName);
        setCustomerAddress(i.customerAddress);
        setCustomerNumber(i.customerNumber);
        setCustomerEmail(i.customerEmail);
        setDueDate(i.compdueDate);
        setPaymentDate(i.paymentDate);
        setTableProductDate(i.tableProductDate);
        setDescription(i.Description);
        setQuntity(i.quntity);
        setRate(i.rate);
        setAmounts(i.amount);
        setTax(i.tax);
        setTaxAmount(i.taxamount);
        setTotalAmount(i.totalAmount);
        setTablePaymentId(i.tablePaymentId);
        setTableBankName(i.tableBankName);
        setTableAccNumber(i.tableAccNumber);
        setTableifscCode(i.tableifscCode);


      })
      console.log(data);
      console.log(data[0]);
      console.log(compName,compAddress);
    })
  }

  return (
    <div>
      <div className="page">
        <div className="HeaderDiv">
          <div className="column">
            <img
              src="https://sourceit.com.ua/images/courses/react.png?111"
              className="ImageLogo"
            ></img>
            <div className="CompanyDetails">
              <h4 name="companyName">[{compName}]</h4>
              <h4 name="companyAddress">[{compAddress}]</h4>
              <h4 name="companyNumber">[{compNumber}]</h4>
              <h4 name="website">
                <a href="https://qliclabs.com/">[qliclabs.com]</a>
              </h4>
            </div>
            <div className="CustomerDetails">
              <h4>Invoice to:</h4>
              <h4>[{customerName}]</h4>
              <h4>[{customerAddress}]</h4>
              <h4>[{customerNumber}]</h4>
              <h4>[{customerEmail}]</h4>
            </div>
          </div>
          <div className="column">
            <h1 className="InvoceHeading">TAX INVOICE</h1>
            <div>
              <div className="InvoiceColumn1">
                <h5>Invoice #</h5>
                <h4>{compinvoiceId}</h4>
                <h5 className="duedate">Due Date</h5>
                <h4>[{compdueDate}]</h4>
              </div>
              <div className="InvoiceColumn2">
                <h5>Invoice Date</h5>
                <h4>{compInvoiceDate}</h4>
                <h5 className="duedate">PaymentDate</h5>
                <h4>[{paymentDate}]</h4>
              </div>
            </div>
          </div>
        </div>
        <table className="table" id="customers">
          <thead>
            <tr>
              <th>Date</th>
              <th>Description</th>
              <th>Qty/Hrs</th>
              <th>Rate</th>
              <th>Amount</th>
            </tr>
          </thead>
          <tbody>
            <tr>
              <td>{tableProductDate}</td>
              <td>{Description}</td>
              <td>{quntity}</td>
              <td>{rate}</td>
              <td>{amount}</td>
            </tr>

            <tr>
              <td></td>
              <td></td>
              <td></td>
              <td></td>
              <td>0.00</td>
            </tr>

            <tr>
              <td></td>
              <td></td>
              <td></td>
              <td></td>
              <td>0.00</td>
            </tr>

            <tr>
              <td></td>
              <td></td>
              <td></td>
              <td></td>
              <td>0.00</td>
            </tr>

            <tr>
              <td></td>
              <td></td>
              <td></td>
              <td></td>
              <td>0.00</td>
            </tr>

            <tr>
              <td></td>
              <td></td>
              <td></td>
              <td></td>
              <td>0.00</td>
            </tr>
          </tbody>
        </table>
        <div>
          <div className="footermainDiv">
            <div className="FooterSubDiv1">
              <h5>Payment Methods:</h5>
              <h4 className="paymentDetails">[{tablePaymentId}]</h4>
              <h4>We accept Visa Master Card, etc</h4>
              <h5 className="bankDetails">Bank Details:</h5>
              <h4>[{tableBankName}]</h4>
              <h4>[{tableAccNumber}]</h4>
              <h4>[{tableifscCode}]</h4>
            </div>
            <div className="FooterSubDiv2">
              <table id="totals">
                <tr>
                  <td>Subtotal</td>
                  <td>{amount}</td>
                </tr>
                <tr>
                  <td>Tax @ {tax}%</td>
                  <td>{taxAmount}</td>
                </tr>
                <tr>
                  <td>Others</td>
                  <td></td>
                </tr>
                <tr>
                  <th>Total</th>
                  <th>{totalAmount}</th>
                </tr>
              </table>
            </div>
          </div>
          <div className="thankyoudiv">
            <h3>Thank You For Your Business!</h3>
          </div>
        </div>
      </div>
      <div className="footerPage">
      <Box sx={{ display: 'block', alignItems: 'flex-end' }}>
        <SearchIcon sx={{ color: 'action.active' }} />
        <TextField id="input-with-sx" label="With sx" variant="standard" sx={{ display: 'block', alignItems: 'flex-end' }} />
      </Box>
        <button onClick={handelevent} style={{display:"block", backgroundColor:"blue"}}>search</button>
      </div>
    </div>
  );
}
